// src/BarcodeSelector.js
import React from 'react';
import { Grid, Card, CardContent, CardMedia, Typography, Button } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import design1 from './images/design1.png';
import design2 from './images/design2.png';
import design3 from './images/design3.png';
import design4 from './images/design4.png';
import design5 from './images/design5.png';
import design6 from './images/design6.png';

const barcodeDesigns = [
    { id: 1, title: 'Design 1', image: design1, route: '/design1' },
    { id: 2, title: 'Design 2', image: design2, route: '/design2' },
    { id: 3, title: 'Design 3', image: design3, route: '/design3' },
    { id: 4, title: 'Design 4', image: design4, route: '/design4' },
    { id: 5, title: 'Design 5', image: design5, route: '/design5' },
    { id: 6, title: 'Design 6', image: design6, route: '/design6' },
];

const BarcodeSelector = () => {
    const navigate = useNavigate();

    return (
        <Grid container spacing={4}>
            {barcodeDesigns.map((design) => (
                <Grid item xs={12} sm={6} md={4} key={design.id}>
                    <Card>
                        <CardMedia
                            component="img"
                            height="140"
                            image={design.image}
                            alt={design.title}
                        />
                        <CardContent>
                            <Typography variant="h5" component="div">
                                {design.title}
                            </Typography>
                            <Button
                                variant="contained"
                                color="primary"
                                onClick={() => navigate(design.route)}
                                style={{ marginTop: '10px' }}
                            >
                                Select
                            </Button>
                        </CardContent>
                    </Card>
                </Grid>
            ))}
        </Grid>
    );
};

export default BarcodeSelector;
